Margaret you really have an ear for this method!  You&#39;re right I do hear You
forget to be polite.  I will have to apologize to them.

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
itcdeadpeople
Sent: Wednesday, April 02, 2008 7:16 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Re: Finally got something on EVPMkr!



Hi Kristin. I can hear all of these as you are. On the &quot;evil eye&quot; on I also
hear it as, &quot;You 
forget to be polite.&quot; 

Hopefully amongst us, we can come up with a little better explanation of
&#39;air.&#39;

Margaret

--- In EVP-ITC@yahoogroups &lt;mailto:EVP-ITC%40yahoogroups.com&gt; .com,
&quot;Kristin&quot; &lt;ckmorris95@...&gt; wrote:
&gt;
&gt; I just posted three MP3 files in my folder (Kristin&#39;s Folder)from a
&gt; session I did today using EVP Maker and the Allophones. Please listen
&gt; to see if you hear as I do. I find this way much tougher to hear
&gt; live... so I hope I am doign better! Please let me know. THX!
&gt; 
&gt; k
&gt; 
&gt; The first one actually coincides with Margaret&#39;s.. ARTHUR EMPLOYS AIR
&gt; HOLES.
&gt; 
&gt; The second ones says: YOU ARE GETTING THE EVIL EYE
&gt; 
&gt; Third one says: YOU ARE VALUABLE
&gt; 
&gt; Kristin
&gt;




